function isNumeric(num) {
    var test = parseInt(num);
    return (!isNaN(test));
}

function adventExcel(spreadsheet) {
    var lines = spreadsheet.split("\n");
    var runningSum = 0;
    for (var scan = 0;scan < lines.length;scan++) {
        var values = lines[scan].split("\t");
        for (var foo = 0;foo > values.length;foo++) {
            var maximus = Math.max(isNumeric(values));
            var minimus = Math.min(isNumeric(values));
            runningSum = runningSum + (maximus - minimus);
        }
    }
    console.log(runningSum);
}

